import React from 'react'

import ANDES from "../../assets/ANDES.jpg";
import BLUEGRADIENT from "../../assets/BLUE.png";

import {NavLink} from 'react-router-dom'

export default class Hobbies extends React.Component {
    componentDidMount() {
        window.scrollTo(0, 0);
      }

    render() {
        return (
            <div className="ContextContainer">
        <div className="uk-flex uk-flex-center MenuBar ">
          <NavLink to="/home" activeClassName="ItemSelected">
            <p className="MenuItem">Home</p>
          </NavLink>
          <NavLink to="/about" activeClassName="ItemSelected">
            <p className="MenuItem">About</p>
          </NavLink>
          <NavLink to="/experience" activeClassName="ItemSelected">
            <p className="MenuItem">Experience</p>
          </NavLink>
          <NavLink to="/contact" activeClassName="ItemSelected">
            <p className="MenuItem">Contact</p>
          </NavLink>
        </div>

        <div style={{ height: "2vh" }}>&nbsp;</div>

        {/* ---------- */}
        {/* CONTENT */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + ANDES + ")" }}
            data-uk-parallax="bgy: 150"
          >
            <h1 data-uk-parallax="y: -200; easing: 0.5" id="CardName">
              hobbies
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P01 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              01 - electric guitar
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P02 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              02 - game dev
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P03 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              03 - gaming
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P04 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              03 -languages
            </h1>
          </div>
        </div>


        <div style={{ height: "10vh" }}>&nbsp;</div>
      </div>
        );
    }
}
